/*
 *
 * Google - DeviantArt style
 *
 * Author      : Alex
 * Updated   : Oct 12th, 2009
 * Website    : http://alexo0.deviantart.com/
 * Description : I love both DeviantArt.com and Google, so I made a style for Google making Google looks like  DeviantArt. Now I have made the homepage and the searching result page of Google.I'll keep modifying some more pages of Google, which I visit daily.
 * If you like this style, keep following the update.
 *
 */


@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document 
url("http://www.google.com/"),
url("http://google.com/"),
url-prefix(http://www.google.com/search), 
url-prefix(http://google.com/search), 
url-prefix(http://www.google.com/webhp), 
url-prefix(http://google.com/webhp),
url-prefix(http://images.google.com/images),
url-prefix(http://images.google.com/)
{
h3, .med{
	font-size:1em !important;
}
body{
	background:#536A5D !important;
	padding:0 !important;
	margin:0 !important;
	font-size:9pt !important;
}
input[type="text"]{
	border:1px solid #A5ACB2;
	background#fff;
}

html,body, td, a, p, .h,input,.gac_sb,li.g, .c h2, #mbEnd h2, h1,#wpz,
#res .e caption,#ss-status,#rpsp .tl,
div.std{
	font-family:Verdana,sans-serif !important;
}
h1,h2,h3,h4,#ssb .std,#imgtbbc{
	font-family:Trebuchet MS,sans-serif  !important;
}
form{
	display:block !important;
}
input{
	font-size:9pt !important;
}
a,#res .link{
	text-decoration:none !important;
	color:#3B5A4A !important;
}
a:hover,#res .link:hover{
	text-decoration:underline !important;
}
#guser a,#gbar a.gb1, #gbar b.gb1, #gbar a.gb2,#gbar a.gb3,#gbar a.gb3 u,#guser a.gb3 u,#ss-status a.gb3 u,#ss-box a{
	font-size:8.25pt !important;
	color:#D6DED4 !important;
	text-decoration:none !important;
}
#ss-box a.ss-selected,#ss-box a.ss-selected:hover{
	color:#AFC81C !important;
}
#guser a:hover,#gbar a.gb1:hover, #gbar a.gb2:hover,a.gb3:hover u,#ss-status a.gb3:hover {
	color:#fff !important;
	text-decoration:none !important;
}
 #gbar b.gb1{
	color:#768E81 !important;
 }
body div#guser{
	background:#40534A;
	color:#768E81 !important;
	padding:5px 10px 7px !important;
	min-width:780px;
	margin:0 17px 0;
	border:1px solid #6B8075;
	border-top:0;
	-moz-border-radius:0 0 7px 7px;
	-webkit-border-radius:7px;
	-webkit-border-top-left-radius:0;
	-webkit-border-top-right-radius:0;
	-khtml-border-radius:0 0 7px 7px;
	border-radius: 0 0 7px 7px;
}
body div#gbar{
	padding:5px 10px 7px !important;
	height:auto !important;
	margin-left:20px !important;
}
#tbp,#res ol li.g,.wpb,.mbi,#rptglbl{
	background:url(data:image/png;base64,) no-repeat !important;
}
.gbh{
	border-top:0;
	top:28px !important;
	display:none;
}
.gb3{
	background:url(data:image/png;base64,) 100% -6px no-repeat;
	padding:0 20px 1px 0;
	outline-style:none !important;
}
#guser a:last-of-type{
	background:url(data:image/png;base64,) 100% -88px no-repeat;
	padding:0 18px 1px 0;
}
#guser div#gbg a{
	background:none !important;
	padding:0.2em 0.5em;
}
#guser a:hover:last-of-type{
	background-position:100% -115px;
}
#gbar #gbi, #gbg, #gbm,#ss-box{
	border:0 !important;
	border-top:1px solid #222C2C !important;
	background:#303E3C !important;
	-moz-appearance: none !important;
	-moz-border-radius:0 0 7px 7px;
	-webkit-border-radius:7px;
	-webkit-border-top-left-radius:0;
	-webkit-border-top-right-radius:0;
	-khtml-border-radius:0 0 7px 7px;
	border-radius: 0 0 7px 7px;
	-moz-box-shadow:4px 4px 8px rgba(0, 0, 0, 0.2);
	-webkit-box-shadow:4px 4px 8px  rgba(0, 0, 0, 0.2);
}
div #gbi a, div #gbg a, div #gbm a,#ss-box a{
	line-height:27px;
	padding:0.2em 0.8em !important;
}
#ss-box a#repha,#ss-box a:last-child{
	padding:0.2em 1.5em !important;
}
#guser a:hover:last-child,#gbi a:hover:last-child,#ss-box a:hover:last-child{
	-moz-border-radius:0 0 7px 7px;
	-webkit-border-radius:7px;
	-webkit-border-top-left-radius:0;
	-webkit-border-top-right-radius:0;
	-khtml-border-radius:0 0 7px 7px;
	border-radius: 0 0 7px 7px;
}
#gbs{
	display:none !important; 
}
div.gb2{
	padding:0 !important;
}
.gbh, .gbd{
	border-top:1px solid #222C2C !important;
	font-size:0 !important;
}
#gbi a:hover,#guser #gbg a:hover,#gbm a:hover,#ss-box a:hover{
	background:#337287 !important;
	text-decoration:none !important;
}

#guser a.gb3 u,#gbar a.gb3 u,#ss-status a.gb3 u{
	color:#AFC81C !important;
	text-transform:capitalize;
}
a.gb3:hover u,a.gb3:focus u{
	color:#C9E322 !important;
}
#guser .gb3{
	padding-right:16px;
}
.gb3 small{
	display:none;
}
.gb3:hover,#ss-status a.gb3:hover{
	background-position:100% -33px;
}
#ss-status{
	padding:0.2em 0.2em;
	color:#fff !important;
	font-size:0.9em;
}
#ss-status a.gb3 u{
	font-size:1em !important;
}
.gb3:focus{
	background-position:100% -60px;
}
#lgpd + #logo{
	margin:30px 0 0;
	clear:both;
	display:block;
	font-size:0;
	width:0 !important;
	height:0 !important;
	padding:118px 0 0 339px;
	background:url(data:image/png;base64,) 0 0 no-repeat;
}
input.lst{
	background: url(data:image/png;base64,) 0 0 no-repeat  !important;
	border:1px solid #343E3C  !important;
	-moz-border-radius: 6px;
	-webkit-border-radius:5px;
	-khtml-border-radius:5px;
	border-radius:5px;
	height:20px;
	width:450px;
	padding:8px 2px 2px;
	padding-left:28px;
	-moz-appearance: none !important;
}
.tc input.lsb,.ft input.lsb{
	position:relative;
	top:1px;
}
#footer center br{
	display:none;
}
font,font a{
	color:#98A8A3 !important;
}
font a:hover{
	color:#C0D0CA !important;
}
.lsb,.gac_sb,input[name="btnG"]{
	background:url(data:image/png;base64,) 0 0 no-repeat  !important;
	width:137px;
	height:27px !important;
	line-height:24px;
	font-size:12px !important;
	text-align:center;
	color:#2C3635;
	border-width:0  !important;
	margin:0.6em .2em !important;
	cursor:pointer !important;
	-moz-appearance: none !important;
	text-shadow: #ccdacd 0px 1px 1px;
}
input[name="btnG"],input.gac_sb:first-of-type{
	font-weight:bold;
}
.lsb:hover,.gac_sb:hover,input[name="btnG"]:hover{
	background-position:0 -27px !important;
}
.lsb:active,.lsb:focus,.gac_sb:active,.gac_sb:focus,input[name="btnG"]:active,input[name="btnG"]:focus{
	background-position:0 -54px !important;
}
.gac_bt{
	text-align:center;
}
font[size="-2"]{
	font-size:11px !important;
	line-height:14px !important;
}
form[name="f"]{
	background:#C5D3C2;
	margin:0 17px 10px !important;
	width:750px;
	padding:45px 0 30px;
	-moz-border-radius: 8px;
	-khtml-border-radius: 8px;
	-webkit-border-radius: 8px;
	border-radius: 8px;
	text-shadow: #CCDACD 0px 1px 1px;
}
form a,form a:hover{
	color:#3B5A4A  !important;
}
form .gac_m{
	vvisibility : visible !important;
	background:#293636 !important;
	color:#D6DED4;
	font-size:1em !important;
	text-shadow:none;
	filter:alpha(opacity=90);
	opacity: 0.9;
	-moz-opacity: 0.9;
	-moz-border-radius: 7px;
	-webkit-border-radius:7px;
	-khtml-border-radius:7px;
	border-radius:7px;
	-moz-box-shadow:4px 4px 8px  rgba(0, 0, 0, 0.3);
	-webkit-box-shadow:4px 4px 8px  rgba(0, 0, 0, 0.3);
	margin-top:3px !important;
	border:0 !important;
}
form .gac_m  td{
	border-left:1px solid #343E3C !important;
	border-right:1px solid #343E3C !important;
	cursor:pointer;
	line-height:1.5em !important;
}
form .gac_m  td a,form .gac_m .gac_h{
	color:#D6DED4 !important;
}
form .gac_m  td a:hover{
	color:#fff !important;
	text-decoration:none !important;
}
form .gac_m tr:first-of-type td{
	-moz-border-radius:7px 7px 0 0;
	-webkit-border-radius:7px;
	-webkit-border-bottom-left-radius:0;
	-webkit-border-bottom-right-radius:0;
	-khtml-border-radius:7px 7px 0 0;
	border-radius:7px 7px 0 0 ;
	border:1px solid #343E3C !important;
	border-bottom:0 !important;
}
form .gac_m tr:last-of-type td{
	-moz-border-radius: 0 0 7px 7px;
	-webkit-border-radius:7px;
	-webkit-border-top-left-radius:0;
	-webkit-border-top-right-radius:0;
	-khtml-border-radius: 0 0 7px 7px;
	border-radius:0 0 7px 7px ;
	background:#1E2828;
	border:1px solid #1E2828 !important;
}
form .gac_m .gac_c{
	padding:0.2em 1em !important;
}
form .gac_m .gac_c b{
	color:#C6DD57;
}
form .gac_m .gac_b,form .gac_b .gac_c,form .gac_m  .gac_b td a,form .gac_m  .gac_b .gac_h{
	background-color:#AACA13 !important;
	color:#394213 !important;
}
form .gac_m .gac_b b{
	color:#394213;
}

/* Search Result Page*/
#cnt{
	max-width:100% !important;
	background:#728776;
}
form[name="gs"] input.lst,#bsf form input.lst,table.ft input.lst{
	padding-top:5px;
	background-position:0 -1px !important;
	height:18px  !important;
}
form[name="gs"] td.tc input.lst,table.ft input.lst{
	height:27px  !important;
	width:480px !important;
}
#logo{
	font-size:0;
	width:auto !important;
	height:49px !important;
}
form[name="gs"] #logo img,form[name="gs"]  td.tc:first-of-type a img,#logo span{
	background:url(data:image/png;base64,) no-repeat !important;
	width:0 !important;
	height:0 !important;
	display:block !important;
	outline-style:none !important;
	padding-left:132px;
	padding-top:49px;
	margin:11px 0 7px !important;
}
#sft a#logo{
	margin:11px 0 7px !important;
	width:132px !important;
	height:49px !important;
	font-size:0;
}
form[name="gs"] #logo img,#logo span{
	margin:0 !important;
	position:static !important;
}
#sft table.tb{
	margin-top:12px !important;
	margin-left:8px !important;
}
#mbEnd td#rhsline{
	border:0 !important;
	padding-top:10px;
}
#mbEnd{
	margin-right:30px !important;
	margin-top:12px !important;
	-moz-border-radius: 5px;
	-webkit-border-radius:5px;
	-khtml-border-radius:5px;
	border-radius:5px;
}
#mbEnd p{
	display:none;
}
form[name="gs"]{
	text-shadow:none  !important;
	margin:0 !important;
	background:#536A5E;
	padding:5px 0 0 !important;
	width:100%;
	-moz-border-radius:0;
	-webkit-border-radius:0;
	-khtml-border-radius:0;
	border-radius:0;
}
form[name="gs"] table#sft{
	margin:0 18px !important;
	padding:0 !important;
	width:auto  !important;
}
.xsm a,.xsm a:hover,#ap a,#ap a:hover{
	color:#fff  !important;
	font-size:1.1em !important;
}
#ssb{
	margin:0 !important;
	padding:0 !important;
	border:0 !important;
	background:#53685C !important;
}
#ssb:after{
    content: "."; 
    display: block; 
    height: 0; 
    clear: both; 
    visibility: hidden;
}
#ssb .std,#imgtbbc{
	color:#3B5A4A;
	font-size:16pt !important;
}
#ssb #tbpi,#rptgl{
	text-shadow:none  !important;
	margin:6px 0 0;
	text-decoration:none !important;
	line-height:17px;
}
#rptgl,.crumbs{
	font-size:1em !important;
}

#tbp,#rptglbl{
	background-position:-452px -3px !important;
	width:18px !important;
	height:17px !important;
}
.tbpo, .tbpc,#rptgl span{
	text-decoration:none !important;
	font-size:1em;
	color:#3B5A4A !important;
}
.tbpo:hover, .tbpc:hover,#rptgl span:hover{
	color:#337287 !important;
}
#prs{
	margin:0.9em 0.5em 0 3em;
	padding:0 !important;
}
p#resultStats,table.bt{
	background:#B1C3AF url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAtCAIAAADgGZaTAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAABVSURBVHjaTI7BDYBQCEML+4+oR6MnR6D2U4weyINCgdyPLa/7TABJBUiRXYMY/atXztY58yWGtJK2yO61j3/a13mY7x7flBeVQf/hm56J6XlXPAIMAI5LQH8/Fb9oAAAAAElFTkSuQmCC) repeat-x !important;
	border-top:0 !important;
	border-bottom:1px solid #9EB1A2;
	-moz-border-radius:7px 7px 0 0;
	-webkit-border-radius:7px;
	-webkit-border-bottom-left-radius:0;
	-webkit-border-bottom-right-radius:0;
	-khtml-border-radius:7px 7px 0 0;
	border-radius:7px 7px 0 0 ;
	margin:0 18px !important;
	padding:1.5em 1.5em 1.3em !important;
	font-size:1em !important;
	color:#50655C !important;
	width:auto !important;
	display:block;
}
#resultStats font{
	color:#50655C !important;
}
table.bt{
	padding:1.3em 1.2em 2.6em !important;
}
table.bt td,table.bt tr,table.bt tbody{
	display:block;
	vertical-align:top !important;
}
table.bt td:first-of-type{
	float:left;
	width:auto !important;
}
td#resultStats{
	width:auto !important;
	float:right;
}
#res,#ImgCont{
	margin:0 !important;
	padding:0 !important;
	font-size:1em !important;
	background:#728776 !important;
}
#res h2.hd + div,#res span#search > div:first-of-type,
#ImgCont table.ts,#ImgContent
{
	margin:0 18px; 
	background:#DFE6DE;
	border-top:1px solid #EFF3EF;
	border-bottom:1px solid #9EB1A2;
}
#sff{
	position:relative;
}
#ss-bar{
	position:static !important;
color:#fff;
font-size:0.9em;
padding-left:0.3em;
}
#ss-status{
padding:0 !important;
}
#ImgCont #ImgContent{
	margin:0 !important;
	border:0 !important;
}
#ImgCont >  table[width="100%"]:first-of-type{
	display:block;
	margin:0 18px !important;
	width:auto !important;
	border-bottom:1px solid #9EB1A2 !important;
	padding:0.5em 1.8em !important;
}
#ImgCont > table.ts{
	font-size:1em !important;
	margin-top:0 !important;
	width:auto !important;
	display:block;
	background-color:#C5D3C2 !important;
	border-bottom:1px solid #9EB1A2 !important;
}
#ImgCont > table.ts td{
	padding:0.8em 2.5em !important;
}
table.ts font{
	font-weight:bold;
	color:#2C3635 !important;
}
#ImgContent{
	padding:1.5em 1em !important;
}
#ImgContent table.ts{
	border:0 !important;
	width:auto !important;
	margin:0 !important;
}
#ImgContent table.ts td{
	text-align:center;
}
#ImgContent table.ts td .std{
	font-size:1em!important;
}
#ImgContent table.ts td div{
	color:#3B5A4A !important;
}
#ImgContent table.ts img{
	border:1px solid #fff !important;
	margin:0 0 0.5em;
	-moz-box-shadow:1px 1px 4px  rgba(0, 0, 0, 0.4);
	-webkit-box-shadow:1px 1px 4px  rgba(0, 0, 0, 0.4);
}
#ImgContent table.ts img:hover{
	-moz-box-shadow:1px 1px 4px  rgba(0, 0, 0, 0.6);
	-webkit-box-shadow:1px 1px 4px  rgba(0, 0, 0, 0.6);
}

#res h2.hd + div ol{
	padding:1em !important;
}
#res h2.hd + div ol li.g{
	margin:0 0 0.6em !important;
	padding:0 1.5em 0.8em 2.5em;
	border-bottom:3px solid #BAC5BA;
	background-position:-1805px 4px !important;
	font-size:1em !important;
}
li hr{
	display:none;
}
#res h2.hd + div ol li.g:last-of-type{
	border-bottom:0;
	margin-bottom:0  !important;
}
li p,#wpz{
	-moz-border-radius: 5px;
	-webkit-border-radius:5px;
	-khtml-border-radius:5px;
	border-radius:5px;
	padding:1em 1.5em;
	margin:0 0 0.5em !important;
	background:#CCD9C8;
}
li div p{
	margin:0.5em 0 0 !important;
}
#wpz{
	font-size:1em;
}
#wpz div:last-of-type{
	margin:0.5em 0 !important;
	border-top:1px solid 9EB1A2 !important;
}
li.g a img,.std a img{
	-moz-box-shadow:1px 1px 3px  rgba(0, 0, 0, 0.3);
	-webkit-box-shadow:1px 1px 3px  rgba(0, 0, 0, 0.3);
	border:1px solid #fff !important;
}
.std a img{
	margin:5px !important;
	padding:0 !important;
	
}
li.g cite a img{
	-moz-box-shadow:none;
	-webkit-box-shadow:none;
}
li.g .r {
	font-size:1.3em !important;
}
li.g .r a{
	color:#196BA7 !important;
	text-decoration:underline !important;
	line-height:1.8em;
}
li.g .s{
	line-height:1.4em;
	padding:0.3em 0;
}
li.g .s .f{
	color:#7C8685;
}
li.g .slk a{
	text-decoration:underline !important;
}
cite, .cite, .cite:link{
	color:#196BA7 !important;
}
#res .e,#res > p:last-of-type,#trev,#res p:first-child,#tads{
	margin:0 18px !important;
	background:#C5D3C2;
	border-top:1px solid #DCE4D9;
	border-bottom:1px solid #9EB1A2;
	padding:1.2em 2em;
	font-size:1em !important;
}
table.std{
	font-size:1em !important;
}
#res #wpz{
	margin:0  0 .5em !important;
	border-bottom:0 !important;
}
span.spell{
	color:#3C5A78 !important;
}
br[clear="all"]{
	display:none !important;
}
#nav,#navbar{
	border-top:1px solid #DCE4D9 !important;
	background:#CCD9C8;
	display:block;
	margin:0 18px  20px!important;
	-moz-appearance: none !important;
	-moz-border-radius:0 0 7px 7px;
	-webkit-border-radius:7px;
	-webkit-border-top-left-radius:0;
	-webkit-border-top-right-radius:0;
	-khtml-border-radius:0 0 7px 7px;
	border-radius: 0 0 7px 7px;
}
#navbar{
	margin-bottom:0!important;
}
#nav td,#navbar td{
	padding:1.5em 3px !important;
}
#nav .csb, .ss,#navbar div{
	background:none !important;
	height:0 !important;
}
#nav td.cur{
	position:relative;
	padding:2em 0.8em  !important;
	color:#3B5A4A !important;
}
#nav td a,#navbar td a,#navbar td span.i{
	display:block;
	padding:0.5em !important;
	width:auto !important;
	outline-style:none !important;
	background-image:url(data:image/gif;base64,) !important;
	padding:7px 20px 2px 15px !important;
	height:19px !important;
	display:inline-block;
}
#nav td a,#navbar td a{
	padding:7px 10px 2px 10px !important;
	background-repeat:repeat-x !important;
	background-position:0 -168px;
	border-right:1px solid #AEBEB2;
}
#nav td.cur a,#nav td.cur a:hover,#nav td.cur a:focus,#navbar td span.i{
	margin-top:-0.5em  !important;
	background-position:0 -252px !important;
	cursor:default !important;
}
#navbar td span.i{
	border-right:1px solid #AEBEB2;
	margin:0  !important;
	padding:7px 15px 2px 15px !important;
}
#nav td.cur a,#nav td.cur a span,#navbar td span.i{
	color:#3B5A4A !important;
}

#nav td a:hover,#navbar td a:hover{
	background-position:0 -196px;
	text-decoration:none !important;
}
#nav td a:focus,#navbar td a:focus{
	background-position:0 -224px;
}
#nav td:first-of-type{
	padding-left:1.5em !important;
}
#nav td:first-of-type a,#navbar td:first-of-type a{
	background-position:0 0;
	border-right:1px solid #AEBEB2;
	padding:7px 32px 2px 38px !important;
	background-repeat:no-repeat !important;
